import React, {Component} from 'react'
import { Header, Icon, Segment, Input, Modal, Button, Embed, Image, Rating, Divider } from 'semantic-ui-react';

class _SearchMovieList extends Component {
    state = {
        isParentOpen: false,
        isChildOpen: false
    }

    handleClick = () => {
        this.setState({
            isParentOpen: !this.state.isOpen
        });
    }

    handleFocus = () => {
        this.setState({
            isChildOpen: true
        });
    }

    render() {
        return (
            <div>
                <Modal
                    open={this.state.isParentOpen}
                    size="large"
                >
                    ...
            <Input onFocus={this.handleFocus} />
                </Modal>
                <Modal
                    open={this.state.isChildOpen}
                    size="small"
                >
                    ...
          </Modal>
                <Button onClick={this.handleClick} />
            </div>
        );
    }
}

export default _SearchMovieList;
